import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
	{ field: 'id', headerName: 'STT', width: 100 },
	{ field: 'code', headerName: 'Mã thành viên', width: 250 },
	{ field: 'name', headerName: 'Tên đăng nhập', width: 250 },
	{
		field: 'phone',
		headerName: 'Số điện thoại',
		type: 'number',
		width: 250,
	},
	{ field: 'email', headerName: 'email', width: 250 },
	{ field: 'register', headerName: 'register', width: 250 },
	{ field: 'status', headerName: 'trạng thái', width: 250 },
	{ field: 'action', headerName: 'Thao tác', width: 250 },
];

const rows = [
	{ id: 1, code: 'Snow', name: 'Jon', phone: 35, email: 'hanhdepgaibkhn@gmail.com', register: '2/1/2021', status: 'Kích hoạt', action: '' },
	{ id: 2, code: 'Lannister', name: 'Cersei', phone: 42 },
	{ id: 3, code: 'Lannister', name: 'Jaime', phone: 45 },
	{ id: 4, code: 'Stark', name: 'Arya', phone: 16 },
	{ id: 5, code: 'Targaryen', name: 'Daenerys', phone: null },
	{ id: 6, code: 'Melisandre', name: null, phone: 150 },
	{ id: 7, code: 'Clifford', name: 'Ferrara', phone: 44 },
	{ id: 8, code: 'Frances', name: 'Rossini', phone: 36 },
	{ id: 9, code: 'Roxie', name: 'Harvey', phone: 65 },
];

export const MembersListContent = () => {
	return (
		<div style={{ height: 400, width: '100%' }}>
			<DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
		</div>
	);
};
